const light = {
  primaryColor: "#007afe",
  bgColor: "#ffffff",
  textColor: "#222",
  roundness: 5,
};

const dark = {
  ...light,
  primaryColor: "#0c84ff",
  bgColor: "#121212",
  textColor: "#e1e1e1",
};

export default {
  light,
  dark,
};
